{"operationName":"headerContent","variables":{"preview":false,"locale":"en-US"},"query":"fragment Link on Link {
  name
  newTab
  url
  page {
    url
    __typename
  }
  __typename
}

fragment LinkDivider on LinkDivider {
  divider
  text
  __typename
}

fragment LinkCollection on LinkCollection {
  name
  rootLink {
    ...Link
    __typename
  }
  sublinksCollection {
    items {
      ...Link
      ...LinkDivider
      __typename
    }
    __typename
  }
  __typename
}

fragment BookstoreCategoryCollection on BookstoreCategoryCollection {
  categoriesCollection(limit: 40) {
    items {
      name
      url
      __typename
    }
    __typename
  }
  __typename
}

query headerContent($preview: Boolean!, $locale: String!) {
  navbarCollection(preview: $preview, locale: $locale, limit: 1) {
    items {
      logo {
        url
        __typename
      }
      itemsCollection(limit: 8) {
        items {
          ...Link
          ...LinkCollection
          __typename
        }
        __typename
      }
      bookstoreCategoryCollection {
        ...BookstoreCategoryCollection
        __typename
      }
      __typename
    }
    __typename
  }
  announcementCollection(preview: $preview, locale: $locale, limit: 5) {
    items {
      value
      link
      onlyOnHomepage
      displayCurrencies
      __typename
    }
    __typename
  }
}
"}

